import React from "react";
import { TiStarOutline } from "react-icons/ti";

// components
import RestaurantNavbar from "../Components/Navbar/restaurantNavbar";
import ImageGrid from "../Components/restaurant/ImageGrid";

const RestaurantLayout = () => {
    return (
        <>
        {" "}
        <RestaurantNavbar />
     <div className="container mx-auto px-4 lg:px-20">
           <ImageGrid 
            images={[
                "https://b.zmtcdn.com/data/pictures/chains/3/17953943/6a5fad222f652d370afef69a765c0a09_featured_v2.jpg?output-format=web",
                "https://b.zmtcdn.com/data/pictures/chains/3/17953943/6a5fad222f652d370afef69a765c0a09_featured_v2.jpg?output-format=web",
                "https://b.zmtcdn.com/data/pictures/chains/3/17953943/6a5fad222f652d370afef69a765c0a09_featured_v2.jpg?output-format=web",
                "https://b.zmtcdn.com/data/pictures/chains/3/17953943/6a5fad222f652d370afef69a765c0a09_featured_v2.jpg?output-format=web",
                "https://b.zmtcdn.com/data/pictures/chains/3/17953943/6a5fad222f652d370afef69a765c0a09_featured_v2.jpg?output-format=web",
            ]}/>
            <div>
                <div>
                   <h1 className="text-xl md:text-3xl font-semifold md:font-bold">
                   The Burger Club
                     </h1>
                     <div>
                         <div>
                             <span className="flex items-center gap-1 text-white font-medium bg-green-600 px-2 py-1">
                                  4.3
                                 <TiStarFullOutline />
                             </span>
                         </div>
                     </div>
                </div>
            </div>

</div> 
</>
    );
};

export default RestaurantLayout;
